This check 
(*keySizePtr > KM_MAX_KEY_SIZE) 
changed its place.
Before your changes, it was performed after SendTzRequest().
After your changes, it's performed before SendTzRequest, and this doesn't make much sense (because why would we worry that the buffer size is too big?).
I suggest to restore the old logic, and just add the new check before it:

if ((keyPtr == NULL) || (keySizePtr == NULL) || (*keySizePtr == 0))
{...}
if (!SendTzRequest(TZDEV_IOCTL_KEYGEN_REQ, keyPtr, keySizePtr, NULL, NULL, NULL, NULL)
    || (*keySizePtr > KM_MAX_KEY_SIZE))
{...}

